import CardList from './CardList';
import {robots} from './Robot.js';
import SearchBox from './SearchBox.js';


class App extends React.Component {

	constructor(){
		this.state = {
			robots: robots,
			searchfield: ''
		}
	}
	render(){
		return(
			<div className = 'tc'>
				<h1>Robofrirnds</h1>
				<SearchBox	/>
				<CardList robots = {robots}/>
			</div>
		);
	}
}


export default App;
